CREATE DEFINER=`sa`@`localhost` FUNCTION `fn_NoEmpleado`(
  ridEmpleado INT
) RETURNS text CHARSET utf8
BEGIN

    DECLARE nvoNoEmpleado VARCHAR(10);

    SET  nvoNoEmpleado = (
      SELECT
        CONCAT(b.idEmpresa,'1',LPAD(a.NoEmpleado, 6, '0'))
      FROM
        BGEEmpleados AS a
        INNER JOIN
        BGECatalogoDepartamentos AS b ON a.NoDepartamento = b.NoDepartamento
      WHERE
        a.idEmpleado = ridEmpleado
    );
    RETURN nvoNoEmpleado;
  END ;;
DELIMITER ;
