CREATE DEFINER=`sa`@`%` FUNCTION `ucwords`(cadena TEXT) RETURNS text CHARSET latin1
BEGIN
-- Funcion para Convertir el Texto en "Tipo Oracion"
    DECLARE pos INT DEFAULT 0;
    DECLARE tmp text DEFAULT '';
    DECLARE result text DEFAULT '';

-- Convertir La Cadena en Minusculas
    SET @minus = LOWER(cadena);

    REPEAT SET pos = LOCATE(' ', @minus);

      IF pos = 0 THEN SET pos = CHAR_LENGTH(@minus);
      END IF;

      SET tmp = LEFT(@minus,pos);
      SET result = CONCAT(result, UPPER(LEFT(tmp,1)),SUBSTR(tmp,2));
      SET @minus = RIGHT(@minus,CHAR_LENGTH(@minus)-pos);

    UNTIL CHAR_LENGTH(@minus) = 0 END REPEAT;

    RETURN result;

  END ;;
DELIMITER ;
