CREATE DEFINER=`sa`@`%` PROCEDURE `sp00_abc_Departamentos`(
  IN rNoDepartamento VARCHAR(10),
  IN ridEmpresa VARCHAR(4),
  IN rNoTipo VARCHAR(2),
  IN rAsignarReportes VARCHAR(2),
  IN rNoSucursal VARCHAR(10),
  IN rDescripcion VARCHAR(70),
  IN rDomicilio VARCHAR(250),
  In ridEstado INT,
  IN ridMunicipio INT,
  IN rTelefono01 VARCHAR(18),
  IN rTelefono02 VARCHAR(18),
  IN rTelefono03 VARCHAR(18),
  IN rTelefono04 VARCHAR(18),
  IN rCorreo VARCHAR(70),
  IN rNoZona INT,
  IN rNoSupervisor INT,
  IN rEncargado INT,
  IN rDiagrama VARCHAR(10),
  IN rNoEstado INT,
  IN rNoUsuarioAlta INT,
  IN rFechaActual VARCHAR(8),
  IN rHoraActual VARCHAR(8),
  IN rOpcion INT
)
BEGIN
-- Validar si existe el departamento Insertarlo
    SELECT @NoDepartamento:=IF(COUNT(NoDepartamento) >= 1,'SI','NO')
    FROM BGECatalogoDepartamentos
    WHERE NoDepartamento = '0001' ;

    CASE rOpcion

      WHEN 1 THEN
-- Alta de Nuevo Departamento
    -- si existe el departamento Insertarlo
      IF @NoDepartamento != 'NO' THEN
        INSERT INTO BGECatalogoDepartamentos
        VALUES (
          rNoDepartamento,ridEmpresa,rNoTipo,
          rAsignarReportes,rNoSucursal,rDescripcion,rDomicilio,ridEstado,ridMunicipio,rTelefono01,rTelefono02,rTelefono03,rTelefono04,
          rCorreo,rNoZona,rNoSupervisor,rEncargado,rDiagrama,rNoEstado,
          rNoUsuarioAlta,rNoUsuarioAlta,rFechaActual,rFechaActual,rHoraActual,rHoraActual
        );
      END IF;
      WHEN 2 THEN
      -- ACtualizar datos del Departamento
      IF @NoDepartamento = 'SI' THEN
        UPDATE BGECatalogoDepartamentos
        SET NoEstado = rNoEstado,
			NoTipo = rNoTipo,
            AsignarReportes = rAsignarReportes,
            NoSucursal = rNoSucursal,
			NoUsuarioUM = rNoUsuarioAlta, 
            Descripcion = rDescripcion,
            Domicilio =  rDomicilio,
            idEstado = ridEstado, 
            idMunicipio = ridMunicipio,
            Telefono01 = rTelefono01,
            Telefono02 = rTelefono02,
            Telefono03 = rTelefono03,
            Telefono04 =rTelefono04,
            Correo = rCorreo,NoZona = rNoZona,NoSupervisor = rNoSupervisor, Encargado = rEncargado,
			FechaUM = rFechaActual,
			HoraUM = rHoraActual
        WHERE NoDepartamento = rNoDepartamento ;
      END IF;
		
      
      WHEN 3 THEN
      -- Desactivar Departamento
		-- si existe el departamento Desactivarlo
      IF @NoDepartamento != 'SI' THEN
        UPDATE BGECatalogoDepartamentos
        SET NoEstado = rNoEstado, NoUsuarioUM = rNoUsuarioAlta,
          FechaUM = rFechaActual,HoraUM = rHoraActual
        WHERE NoDepartamento = rNoDepartamento ;
      END IF;


    END CASE ;


  END ;;
DELIMITER ;
