CREATE DEFINER=`sa`@`%` PROCEDURE `sp01_info_ticket`(
IN rAnio VARCHAR(6),
IN rFolio VARCHAR(6),
IN rNoDepartamento VARCHAR(6)
)
BEGIN

SELECT 
    a.NoSucursal,
    b.Correo AS CorreoDpto,
    b.Descripcion,
    a.idEmpleado,
    a.DescripcionReporte,
    a.Fecha,
    a.HoraInicioReporte,
    b.NoTipo,
    c.Nombre,
    c.ApPaterno,
    c.ApMaterno,
    c.Correo as Solicitante,
    a.Estatus,
    a.NoUsuarioAsignado,
    d.Descripcion,
    a.Reporte,
    d.Correo as EncargadoDpto,
    a.NoDepartamento,
    CONCAT_WS(' ', c.Nombre, c.ApPaterno, c.ApMaterno) AS NombreCompleto,
    f.NombreDePila,
    e.NombreDePila,
    CONCAT_WS(' ',g.Nombre,g.ApPAterno,g.ApMaterno)
FROM
    BSHReportes AS a
        LEFT JOIN
    BGECatalogoDepartamentos AS b ON a.NoSucursal = b.NoDepartamento
        LEFT JOIN
    BGEEmpleados AS c ON a.idEmpleado = c.idEmpleado
        LEFT JOIN
    BGECatalogoDepartamentos AS d ON a.NoDepartamento = d.NoDepartamento
        LEFT JOIN
    BGECatalogoUsuarios AS e ON a.NoUsuarioAsignado = e.NoUsuario
        LEFT JOIN
    BGECatalogoUsuarios AS f ON a.NoUsuarioRecibe = f.NoUsuario
		LEFT JOIN
    BGEEmpleados AS g ON d.Encargado= g.idEmpleado
    
WHERE
    a.Anio = rAnio AND a.Folio = rFolio
        AND a.NoDepartamento = rNoDepartamento;
        
-- Consulta Numero 2
SELECT 
    a.Seguimiento, b.NombreDePila,a.FechaSeguimiento,a.HoraInicioSeguimiento
FROM
    BSHSeguimientoReportes AS a
        LEFT JOIN
    BGECatalogoUsuarios AS b ON a.NoUsuarioSeguimiento = b.NoUsuario
WHERE
    a.Anio = rAnio AND a.Folio = rFolio
        AND a.NoDepartamento = rNoDepartamento
ORDER BY a.FolioSeguimiento DESC
LIMIT 1; 


END ;;
DELIMITER ;
