CREATE DEFINER=`sa`@`localhost` PROCEDURE `sp_ActualizaPerfil`(
  IN rNoUsuario INT,
  IN rNoSucursal VARCHAR(10),
  IN rNombreSucursal VARCHAR(60),
  IN rNombreUsuario VARCHAR(60),
  IN rNombreCorto VARCHAR(60),
  IN rCorreo VARCHAR(70),
  IN rTelefono VARCHAR(20),
  IN rTelefono2 VARCHAR(20),
  IN rCelular VARCHAR(25),
  IN rDireccion VARCHAR(80),
  IN rFecha VARCHAR(8),
  IN rHora VARCHAR(8),
  IN rNoUsuarioUM INT,
  IN rApMaterno VARCHAR(20),
  IN rApPaterno VARCHAR(20),
  IN rUsuarioLogin INT,
  IN rPassword VARCHAR(50)
  )
BEGIN
-- Rutina para la Actualizar los datos en la Tabla Empleados
    UPDATE BGEEmpleados
    SET Nombre = rNombreUsuario,
      ApPaterno = rApPaterno,
      ApMaterno = rApMaterno,
      Correo = rCorreo,
      Telefonoe01 = rTelefono,
      Telefonoe02 = rTelefono2,
      Direccion = rDireccion,
      NoUsuarioUM = rNoUsuarioUM,
      FechaUM = rFecha,
      HoraUM = rHora
    WHERE idEmpleado = rNoUsuario;

-- Actualizar el Nombre de Pila en la Tabla de BGECatalogoUsuarios
    UPDATE BGECatalogoUsuarios
    SET NombreDePila = rNombreCorto,
      NoUsuarioUM = rNoUsuarioUM,
      FechaUM = rFecha,
      HoraUM = rHora
    Where idEmpleado = rNoUsuario AND NoUsuario = rUsuarioLogin;

  END ;;
