CREATE DEFINER=`pexpress`@`%` PROCEDURE `sp_actualiza_conexion`(
  IN r_opc INT,
  IN r_Usuario INT,
  IN r_Ip VARCHAR(18),
  IN r_IpProxy VARCHAR(18),
  IN r_HostName VARCHAR(60),
  IN r_USER_AGENT TEXT,
  IN r_REQUEST_TIME VARCHAR(50),
  in r_Fecha DATETIME
)
BEGIN
    declare ExistConexion INT;

    SET ExistConexion = (SELECT fn_existe_conexion(r_Usuario));

    CASE r_opc
    -- Insertar Nuevo Usuario desde la pantalla de inicio de sesion
      WHEN 1 THEN
      
      IF ExistConexion > 0 THEN
      -- si ya habia iniciado la sesion al menos una vez, solo se actualizaran los datos
        UPDATE BGEConexiones
        SET Noip = r_Ip,
          Noipproxy = r_IpProxy,
          HostName = r_HostName,
          User_Agent = r_USER_AGENT,
          Estatus = "C",
          REQUEST_TIME = r_REQUEST_TIME,
          FechaConexion = r_Fecha
        WHERE NoUsuario = r_Usuario;
        
      ELSE
        -- si es la primera vez que inicia sesion se inserta su usuario y los datos
        INSERT INTO BGEConexiones (
        NoUsuario,Noip,Noipproxy,HostName,User_Agent,Estatus,REQUEST_TIME,NoUsuarioUM,FechaConexion
        )
        VALUES
          (
          r_Usuario,
          r_Ip,
          r_IpProxy,
          r_HostName,
          r_USER_AGENT,
          'C',
          r_REQUEST_TIME,
          r_Usuario,
          r_Fecha
          );
          
      END IF;
      
      UPDATE BGECatalogoUsuarios SET Intentos = 0 WHERE NoUsuario = r_Usuario ;
      
-- SELECT @dat := NoUsuario FROM BGEConexiones WHERE NoUsuario = r_Usuario;
      WHEN 2 THEN
      -- Desconectar Usuario
      UPDATE BGEConexiones
      SET Noip = r_Ip,
          Noipproxy = r_IpProxy,
          HostName = r_HostName,
          User_Agent = r_USER_AGENT,
          Estatus = 'D',
          REQUEST_TIME = r_REQUEST_TIME,
          FechaDesconexion = r_Fecha
      WHERE NoUsuario = r_Usuario;
    END CASE;
  END ;;
