CREATE DEFINER=`root`@`%` PROCEDURE `sp_Adjuntar_file_Equipos`(
  r_Folio INT(11),
  r_TipoArchivo INT(11),
  r_NombreArchivo VARCHAR(45),
  r_RutaArchivo VARCHAR(45),
  r_FechaAlta VARCHAR(8),
  r_HoraAlta VARCHAR(8),
  r_UsuarioSube INT(11),
  r_IP INT(14),
  r_IP_Proxy INT(14),
  r_Parametro INT(11)
)
BEGIN
    DECLARE _UltimoID INT(0);
    SELECT @IdMayor:=MAX(IDArchivo)
    FROM SINTEGRALGNL.BSHAdjuntosEquipos
    WHERE Folio = r_Folio;
    IF @IdMayor > 0 THEN
      SET _UltimoID = @IdMayor + 1;
    ELSE
      SET _UltimoID = 1;
    END IF;
    INSERT INTO SINTEGRALGNL.BSHAdjuntosEquipos
    (Folio,IDArchivo,TipoArchivo,NombreArchivo,RutaArchivo,FechaAlta,HoraAlta,UsuarioSube,Estatus,IP,IP_Proxy)
    VALUES
      (r_Folio,_UltimoID,r_TipoArchivo,r_NombreArchivo,r_RutaArchivo,r_FechaAlta,r_HoraAlta,r_UsuarioSube,1,r_IP,r_IP_Proxy);
  END ;;
