CREATE DEFINER=`sa`@`localhost` PROCEDURE `sp_AgregaAdjunto`(
  IN r_NoSucursal VARCHAR(10),
  IN r_Anio INT(11),
  IN r_Folio INT(11),
  IN r_NoDepartamento VARCHAR(10),
  IN r_FechaAlta VARCHAR(8),
  IN r_HoraAlta VARCHAR(8),
  IN r_RutaAdjunto VARCHAR(80),
  IN r_NombreAdjunto VARCHAR(250),
  IN r_UsuarioSube INT(11),
  IN r_IP VARCHAR(12),
  IN r_IP_Proxy VARCHAR(12),
  IN r_TipoArchivo INT(11)
)
BEGIN

    declare v_UltimoID INT;

    SELECT @IDMayor:=MAX(ID) FROM BSHAdjuntos WHERE NoDepartamento = r_NoDepartamento AND Anio = r_Anio AND Folio = r_Folio;

    IF @IDMayor > 0 THEN
      SET v_UltimoID = @IDMayor + 1;
      INSERT INTO BSHAdjuntos (Anio,Folio,NoDepartamento,ID,FechaAlta,HoraAlta,RutaAdjunto,NombreAdjunto,UsuarioSube,Estatus,IP,IP_Proxy,NoSucursal,TipoArchivo)
      VALUES(r_Anio,r_Folio,r_NoDepartamento,v_UltimoID,r_FechaAlta,r_HoraAlta,r_RutaAdjunto,r_NombreAdjunto,r_UsuarioSube,1,r_IP,r_IP_Proxy,r_NoSucursal,r_TipoArchivo);
    ELSE
      SET @IDMayor = 1;
      INSERT INTO BSHAdjuntos (Anio,Folio,NoDepartamento,ID,FechaAlta,HoraAlta,RutaAdjunto,NombreAdjunto,UsuarioSube,Estatus,IP,IP_Proxy,NoSucursal,TipoArchivo)
      VALUES(r_Anio,r_Folio,r_NoDepartamento,@IDMayor,r_FechaAlta,r_HoraAlta,r_RutaAdjunto,r_NombreAdjunto,r_UsuarioSube,1,r_IP,r_IP_Proxy,r_NoSucursal,r_TipoArchivo);
    END IF;
  END ;;
DELIMITER ;
