        INSERT INTO BSHCatalogoAreas

        VALUES(@UltimoNoArea,r_Nombre,r_NoDepartamento,r_FechaActual,r_FechaActual);

      END IF;

    else

      select * FROM BSHREportes LIMIT 1;

