BEGIN
-- Validar que el Usuario, por Nombre Apellido paterno y Departamento No Exista ya Registrado
    IF ((SELECT
           count(idEmpleado)
         FROM BGEEmpleados
         WHERE NoEmpleado = rNoEmpleado) > 0)
