      );
    ELSE

-- Si No Existe registrado se procede a Insertar el Registro
      INSERT INTO BGEEmpleados
      VALUES (
        NULL,
        rNoDepartamento,
        rNoEmpleado,
        rNombre,
        rApPaterno,
        rApMaterno,
        rCorreo,
        rDireccion,
