        rTelefonoe03,
        ridPhoto,
        rNoUsuarioAlta,
        rNoUsuarioUM,
        rNoPuesto,
        rNoEstado,
        rFechaAlta,
        rHoraAlta,
        rFechaUM,
        rHoraUM
      );
      SELECT ("OK");

    END IF;

  END ;;
