CREATE DEFINER=`sa`@`localhost` PROCEDURE `sp_AsignacionEquipo`(
  IN v_FechaRegistro VARCHAR(8),
  IN v_HoraRegistro VARCHAR(8),
  IN v_UsuarioRecibe INT(11),
  IN v_NombreCompleto VARCHAR(60),
  IN v_NoDepartamento VARCHAR(10),
  IN v_Puesto VARCHAR(45),
  IN v_Equipo VARCHAR(40),
  IN v_Marca VARCHAR(25),
  IN v_Modelo VARCHAR(45),
  IN v_Procesador VARCHAR(35),
  IN v_Memoria VARCHAR(45),
  IN v_Disco VARCHAR(45),
  IN v_Caracteristicas TEXT,
  IN v_CodigoCedis VARCHAR(6),
  IN v_SerieCedis VARCHAR(11),
  IN v_SerieEquipo VARCHAR(30),
  IN v_MotivoAsignacion  TEXT,
  IN v_FechaAsignacion VARCHAR(8),
  IN v_Estatus INT(11))
BEGIN
    INSERT INTO SINTEGRALGNL.BSHInventarioEquipos
    (FechaRegistro,HoraRegistro,UsuarioRecibe,NombreCompleto,NoDepartamento,
     Puesto,Equipo,Marca,Modelo,Procesador,Memoria,Disco,Caracteristicas,CodigoCedis,
     SerieCedis,SerieEquipo,MotivoAsignacion,FechaAsignacion,Estatus)
    values
      (v_FechaRegistro,v_HoraRegistro,v_UsuarioRecibe,v_NombreCompleto,v_NoDepartamento,
       v_Puesto,v_Equipo,v_Marca,v_Modelo,v_Procesador,v_Memoria,v_Disco,v_Caracteristicas,v_CodigoCedis,v_SerieCedis,
       v_SerieEquipo,v_MotivoAsignacion,v_FechaAsignacion,v_Estatus);
    SELECT @Folio:= MAX(Folio),@NombreUser:=CU.NombreDePila
    FROM SINTEGRALGNL.BSHInventarioEquipos AS IE
