CREATE DEFINER=`sa`@`%` PROCEDURE `sp_BGE_RegistraBitacora`(IN rOpcion INT(11),IN rid_Rubro INT(11),IN rNoRubro VARCHAR(20),IN rOperacion VARCHAR(80),IN rFormularioRegistra VARCHAR(80),
                                                            IN rLlaveRegistro VARCHAR(20),IN rCampo VARCHAR(255),IN rCampo2 VARCHAR(255),IN rDatoActual text,in rDatoNuevo text,in rDescripcion text,
                                                            IN rNoUsuario INT(11),IN rFechaActualizacion VARCHAR(8),In rHoraActualizacion VARCHAR(8)
)
BEGIN
    DECLARE v_id_rubro INT;
    DECLARE v_Desc_TPoArticulo_ant VARCHAR(150);
    DECLARE v_Desc_TPoArticulo_nvo VARCHAR(150);
    DECLARE v_Desc_NoMarca_ant VARCHAR(150);
    DECLARE v_Desc_NoMarca_nvo VARCHAR(150);
-- SI rOpcion es 1 = Registro de Nuevo Articulo
-- Se Procede a Registrar el Articulo Nuevo en la Bitacora de Movimientos
    SET v_id_rubro = (SELECT fn_BGE_id_Rubro(rLlaveRegistro,1));

    if(v_id_rubro >= 1) THEN
      SET @id_Rubro = v_id_rubro +1;
    ELSE
      SET @id_Rubro = 1;
    END IF;
    CASE rCampo
      WHEN 'Clasificacion02' THEN
      SET v_Desc_TPoArticulo_ant = (SELECT fn_BOP_DescripcionTpoArticulo(rDatoActual,5));
      SET v_Desc_TPoArticulo_nvo = (SELECT fn_BOP_DescripcionTpoArticulo(rDatoNuevo,5));
      SET rDatoActual = v_Desc_TPoArticulo_ant;
      SET rDatoNuevo = v_Desc_TPoArticulo_nvo;
      WHEN 'Clasificacion03' THEN
      SET v_Desc_NoMarca_ant = (SELECT fn_BOP_DescripcionTpoArticulo(rDatoActual,6));
      SET v_Desc_NoMarca_nvo = (SELECT fn_BOP_DescripcionTpoArticulo(rDatoNuevo,6));
      SET rDatoActual = v_Desc_NoMarca_ant;
      SET rDatoNuevo = v_Desc_NoMarca_nvo;
    ELSE
      BEGIN
      END;
    END CASE;
-- Insertar Nuevo Registro en la Bitacora
    INSERT INTO BGEBitacora VALUES(
      @id_Rubro,rNoRubro,rOperacion,rFormularioRegistra,rLlaveRegistro,rCampo,rCampo2,rDatoActual,rDatoNuevo,
      rDescripcion,rNoUsuario,rFechaActualizacion,rHoraActualizacion);
  END ;;
DELIMITER ;
