  IN rNoSucursal VARCHAR(10),
  IN rNoZona INT,
  IN rNoSupervisor INT,
  IN rCodProducto VARCHAR(10),
  IN rNoCategoria INT,
  IN rNoUsuario VARCHAR(6),
  IN rNombreUsuario VARCHAR(60),
  IN rNombreCorto VARCHAR(15),
