CREATE DEFINER=`sa`@`%` PROCEDURE `sp_BOP_RegistraArticulo`(
IN rParamRegistro INT,
IN rCodigoProducto VARCHAR(15),
IN rDescripcion text,
IN rClasificacion01 VARCHAR(100),
IN rClasificacion02 VARCHAR(100),
IN rClasificacion03 VARCHAR(100),
IN rClasificacion04 VARCHAR(100),
IN rClasificacion05 VARCHAR(100),
IN rClasificacion06 VARCHAR(100),
IN rClasificacion07 VARCHAR(100),
IN rClasificacion08 VARCHAR(100),
IN rClasificacion09 VARCHAR(100),
IN rClasificacion10 VARCHAR(100),
IN rImporteVenta decimal(19,2),
IN rImporte01 decimal(19,2),
IN rImporte02 decimal(19,2),
IN rImporte03 decimal(19,2),
IN rImporte04 decimal(19,2),
IN rImporte05 decimal(19,2),
IN rNombreFotogragia TEXT,
IN rNoEstatus VARCHAR(2),
IN rNoUsuarioAlta INT(11),
IN rNoUsuarioUM INT(11),
IN rFechaAlta VARCHAR(8),
IN rHoraAlta VARCHAR(8),
IN rFechaUM VARCHAR(8),
IN rHoraUM VARCHAR(8),
OUT N_NumFolio INT
)
BEGIN
-- Traer el Ultimo Registro de los Productos Excepto los 9999 y 99999

-- Traer el Ultimo Registro de los Productos Excepto los 9999 y 99999
    DECLARE v_UltimoProducto INT;
    DECLARE V_nombreFoto VARCHAR(50);

    SET v_UltimoProducto = (SELECT fn_BOP_UltimoProducto(1));

-- Sumar el UltimoRegistro + 1
    SET  @UltimoArticulo = v_UltimoProducto + 1;
    SET v_nombreFoto = CONCAT(@UltimoArticulo,'.jpg');


-- Registrar el Articulo con el Nuevo NoArticulo
    INSERT INTO BOPCatalogoProductos VALUES
      (@UltimoArticulo,rDescripcion,rClasificacion01,rClasificacion02,rClasificacion03,rClasificacion04,
       rClasificacion05,rClasificacion06,rClasificacion07,rClasificacion08,rClasificacion09,rClasificacion10,
       rImporteVenta,rImporte01,rImporte02,rImporte03,rImporte04,rImporte05,v_nombreFoto,rNoEstatus,
       rNoUsuarioAlta,rNoUsuarioUM,rFechaAlta,rHoraAlta,rFechaUM,rHoraUM);

-- Llamar al SP (sp_BGE_RegistraBitacora), Para Registrar la Transaccione en la Bitacora de Movimientos - General
    CALL sp_BGE_RegistraBitacora(1,0,1,"A","FrmNvoProducto",@UltimoArticulo,"","","","","Alta",rNoUsuarioAlta,rFechaAlta,rHoraAlta);

    SELECT @UltimoArticulo INTO N_NumFolio FROM BOPCatalogoProductos ORDER BY Descripcion DESC LIMIT 0,1;


  END ;;
