CREATE DEFINER=`sa`@`%` PROCEDURE `sp_BuscarTicket`(



  IN r_Ticket INT,



  IN r_NoDepartamento INT ,



  IN r_TipoBusqueda INT



)
BEGIN



    SELECT R.Folio,R.NoDepartamento,R.Fecha,S.NombreSucursal,R.QuienReporta,R.DescripcionReporte ,U.NombreDePila,R.Estatus



    FROM BSHReportes AS R



      JOIN BSHCatalogoSucursales AS S



        ON R.NoSucursal= S.NoSucursal



      left JOIN BSHCatalogoUsuarios AS U



        ON R.NoUsuarioAsignado = U.NoUsuario AND U.NoDepartamento=r_NoDepartamento



    WHERE R.NoDepartamento=r_NoDepartamento



          AND R.Folio = r_Ticket ORDER BY R.Fecha DESC;



  END ;;
