CREATE DEFINER=`sa`@`%` PROCEDURE `sp_ChangeFechaPromesa`()
BEGIN



    DECLARE v_TotalRegistros INT;



    DECLARE v_Cont INT;



    SELECT @TotalRegistro :=COUNT(*) FROM BSHReporteRubros WHERE Estatus >3;



-- SELECT @Num:=1 + ROUND(RAND() * (5 - 1));



    SET v_Cont = 1;



    WHILE v_Cont < @TotalRegistro DO



      SELECT @Num:=1 + ROUND(RAND() * (5 - 1));



      SELECT @UltimoDia :=RIGHT(FechaReal, 2) FROM BSHReporteRubros WHERE Estatus > 3 LIMIT v_Cont;



      IF @UltimoDia > 05 THEN



        UPDATE BSHReporteRubros SET FechaPromesa = (FechaReal - @Num) WHERE Anio>2009 AND NoDepartamento = 2 AND Estatus >3 AND FechaPromesa <> FechaReal;



      END IF;



      SET v_Cont = v_Cont + 1;



    END WHILE;







  END ;;
DELIMITER ;
