  IN rOpcion INT
)
BEGIN

    UPDATE BGECatalogoUsuarios
    SET idEmpleado = rIdEmpleado,
      NoDepartamento = rNoDepartamento,
      NombreDePila = rNombreDePila,
      NoEstado = rNoEstado,
      NoPerfil = rNoPerfil,
