      PassTemp = rPassLogin,
      NoUsuarioUM = rNoUsuarioAlta,
      FechaUM = rFechaAlta,
      HoraUM = rHoraAlta
    WHERE NoUsuario = rNoUsuario ;

    IF rOpcion = 1 THEN
-- Desactiva todos los accesos al Menu Principal

      UPDATE 00GNMenuAccesos
      SET OpcionAlta = 0,
        OpcionBaja = 0,
        OpcionCambio = 0,
        OpcionVista = 0,
        OpcionReportes = 0
      WHERE
        NoUsuario = rNoUsuario AND
        idModulo >= 1 AND
        idSeccion >= 1 AND
        idOpcion >= 1 ;

    END IF;


  END ;;
