  r_TipoAtencion CHAR(2),
  r_FechaPromesa VARCHAR(8),
  r_Seguimiento text,
  r_FechaSolicitud VARCHAR(9),
  r_MedioContacto INT(11),
  r_PerfilUsuario INT(11),
  r_NoUsuarioAsignado INT(11)
)
BEGIN
-- prueba
    SELECT @estatus:=Estatus from BSHReportes WHERE Anio=r_AnioTicket AND NoDepartamento = r_NoDepartamento AND Folio=r_Folio;
    IF r_PerfilUsuario = 5 THEN
-- Acutalizando Datos
      UPDATE SINTEGRALGNL.BSHReportes SET
        idEmpleado=r_Solicita,
        DescripcionReporte=r_Descripcion,
        NoSucursal=r_Sucursal,
        NoArea=r_Area,
        Categoria=r_Categoria,
