        Estatus=r_Estatus,
        MedioContacto=r_MedioContacto,
        TipoMantenimiento=r_TpoServicio,
        NoUsuarioAsignado = r_NoUsuarioAsignado
      WHERE Folio=r_Folio AND NoDepartamento=r_NoDepartamento AND Anio=r_AnioTicket;
-- Ingresando el Seguimiento de Edicion en la Tabla
      CALL sp_SeguimientoReporte(
          r_AnioTicket,r_Folio,
          r_NoDepartamento,r_TipoAtencion,
          r_Seguimiento,r_UsuarioEdita,
          r_Estatus,r_Fecha,r_Hora
      );
    ELSE
-- Acutalizando Datos
      UPDATE SINTEGRALGNL.BSHReportes
      SET DescripcionReporte=r_Descripcion,
        Reporte= r_Reporte,
        TipoMantenimiento=r_TpoServicio,
        NoArea=r_Area,
        NoSucursal=r_Sucursal,
        idEmpleado=r_Solicita,
        Categoria=r_Categoria,
        NoUsuarioAsignado = r_NoUsuarioAsignado
      WHERE Folio=r_Folio AND NoDepartamento=r_NoDepartamento AND Anio=r_AnioTicket;
-- Ingresando el Seguimiento de Edicion en la Tabla
      CALL sp_SeguimientoReporte(
          r_AnioTicket,r_Folio,
          r_NoDepartamento,r_TipoAtencion,
          r_Seguimiento,r_UsuarioEdita,
          r_Estatus,r_Fecha,r_Hora
      );
    END IF;
  END ;;
