CREATE DEFINER=`sa`@`%` PROCEDURE `sp_FechaPromesaOpen`()
BEGIN



    DECLARE i INT; #Contador



    DECLARE v_TotalRegistros INT; #Total de Registros Abiertos ->



    SET i=1;



    SELECT @TotalRegistros:= COUNT(*) FROM BSHReporteRubros WHERE Estatus < 4;



    WHILE i < @TotalRegistros DO



      SELECT @Ndia:=RIGHT(FechaPromesa, 2), @Dia:=RIGHT(FechaPromesa, 4), @MES:=LEFT(@Dia,2), @Anio:=LEFT(FechaPromesa, 4) FROM BSHReporteRubros WHERE Estatus < 4;



      SELECT @num:= 1 + ROUND(RAND() * (3 - 1)) + @MES;



      IF @MES < 9 THEN



        UPDATE BSHReporteRubros SET FechaPromesa = CONCAT(@Anio,0,@num,@Ndia) WHERE Anio>2009 AND NoDepartamento=2 AND Estatus < 4;



      END IF;



      SET i=i+1;



    END WHILE;



  END ;;
DELIMITER ;
