SELECT @User:=a.NoUsuario as NoUsuario,c.Nombre,concat_ws(' ',c.Nombre,c.ApPaterno,c.ApMaterno) as NombreCompleto,c.ApPaterno,c.ApMaterno,a.NombreDePila,a.UsuarioLogin,a.NoDepartamento,a.BDDatos,
      a.NoPerfil,@NoEstatus:=a.NoEstado as NoEstatus,c.idphoto,c.idEmpleado,c.correo,a.Intentos,e.FechaConexion,e.Estatus,e.Noip,e.Noipproxy,e.HostName,e.User_Agent,a.PassLogin,e.REQUEST_TIME,f.Descripcion as NombreConexion,c.NoEmpleado
