CREATE DEFINER=`sa`@`localhost` PROCEDURE `sp_NuevaCaja`(
  IN rNoSucursal VARCHAR(6)
)
BEGIN
-- Alta de Usuario Sucursal
-- Numero de la sucursal en la cual se ingresara una nueva caja
    SET @NoSucursal = rNoSucursal;

/**
 ** No Modificar el Siguiente Query
 ** Creador: @Alejandro Gomez
 ** Fecha: 14/04/2016
 ** Hora: 02:01:pm
**/
    SELECT @UsuarioLogin:=concat(
        (left(UsuarioLogin,length(UsuarioLogin) - 2)),
        '0',
        (right(UsuarioLogin,2)+ 1)
    ),@NoUsuarioPerfil:=NoUsuario
    FROM BSHCatalogoUsuarios
    WHERE NoSucursal = @NoSucursal
    ORDER BY NoUsuario DESC LIMIT 0,1;

    SELECT @NewUser:=MAX(NoUsuario) + 1
    FROM BSHCatalogoUsuarios;

    INSERT INTO BSHCatalogoUsuarios
      SELECT @NewUser,@UsuarioLogin,@UsuarioLogin,CorreoUsuario,@UsuarioLogin,PassLogin,NoDepartamento,Perfil,EstadoUser,
        FechaAlta,FechaUM,Domicilio01,Telefono01,Telefono02,Telefono03,idphoto,NoSucursal,NoZona,NoSupervisor,NoPuesto
      FROM BSHCatalogoUsuarios
      WHERE NoUsuario = @NoUsuarioPerfil;

    INSERT INTO BSIModuloOpciones
      SELECT @NewUser,CodCatalogo,CodModulo,Opcion1,Opcion2,Opcion3,Opcion4,Opcion5,Descripcion,Url,Marca
      FROM BSIModuloOpciones
      WHERE NoUsuario = @NoUsuarioPerfil;

    SELECT *
    FROM BSHCatalogoUsuarios
    WHERE NoUsuario = @NewUser;

  END ;;
DELIMITER ;
