CREATE DEFINER=`sa`@`%` PROCEDURE `sp_RegistraUsuario`(
  IN rIdEmpleado INT,
  IN rNoDepartamento VARCHAR(10),
  IN rNoPerfil INT,
  IN rNombreDePila VARCHAR(40),
  IN rUsuarioLogin VARCHAR(40),
  IN rPassLogin VARCHAR(50),
  IN rPassTemp VARCHAR(50),
  IN rReportes VARCHAR(2),
  IN rNoEstado INT,
  IN rNoUsuario INT,
  IN rFechaAlta VARCHAR(8),
  IN rHoraAlta VARCHAR(8),
  OUT e_NoUsuario INT
)
BEGIN

    declare addUser INT;

    INSERT INTO BGECatalogoUsuarios VALUES (
      null,rIdEmpleado,rNoDepartamento,rNoPerfil,rNombreDePila,rUsuarioLogin,rPassLogin,rPassTemp,0,rReportes
      ,rNoEstado,rNoUsuario,rNoUsuario,rFechaAlta,rFechaAlta,rHoraAlta,rHoraAlta);

    SET addUser = (SELECT @@identity AS id );

    INSERT INTO 00GNMenuAccesos
      SELECT
        addUser,idModulo,idSeccion,idOpcion,0,0,0,0,0,rNoUsuario,now(),rNoUsuario,now()
      FROM
        SINTEGRALGNL.00GNMenuModulos WHERE idSeccion != 0 AND idOpcion != 0;

    SELECT addUser INTO e_NoUsuario FROM SINTEGRALGNL.BGECatalogoUsuarios ORDER BY NoUsuario DESC LIMIT 0, 1;

  END ;;
