CREATE DEFINER=`root`@`%` PROCEDURE `sp_SeguimientoEquipos`(
  r_Folio INT(11),
  r_FechaSeguimiento VARCHAR(8),
  r_HoraSeguimiento VARCHAR(8),
  r_Seguimiento TEXT,
  r_TipoSeguimiento VARCHAR(5),
  r_Estatus INT(11),
  r_NoUsuarioSeguimiento INT(11)
)
BEGIN
    DECLARE _UltimoSeguimiento INT(0);
    SELECT @MaxSeg:=MAX(NoSeguimiento)
    FROM SINTEGRALGNL.BSHSeguimientoEquipos
    WHERE Folio = r_Folio;

    IF @MaxSeg > 0 THEN
      SET _UltimoSeguimiento = @MaxSeg + 1;
    ELSE
      SET _UltimoSeguimiento = 1;
    END IF;
    INSERT INTO SINTEGRALGNL.BSHSeguimientoEquipos
    VALUES
      (r_Folio, _UltimoSeguimiento,r_FechaSeguimiento,r_HoraSeguimiento,r_Seguimiento,r_TipoSeguimiento,r_Estatus,r_NoUsuarioSeguimiento);
  END ;;
DELIMITER ;
