CREATE DEFINER=`sa`@`localhost` PROCEDURE `sp_SeguimientoReporte`(
  in r_anio int(11),
  in r_Folio int(11),
  in r_NoDepartamento VARCHAR(10),
  in r_TipoAtencion char(1),
  in r_Seguimiento text,
  in r_NoUsuarioSeguimiento int(11),
  in r_NoEstatus int(11),
  in r_FechaSeguimiento char(8),
  in r_HoraInicioSeguimiento char(8)
)
BEGIN
    DECLARE num_estatus INT default 0;
    DECLARE num_folio INT default 0;

    SET num_estatus = r_NoEstatus;
    SET num_folio = r_Folio;
    SET @UltimoSeguimiento=1;

-- ---------------------------------------------------------------------
-- ## Evaluar el Estatus del Ticket
-- ## Revisar si el REgistro Existe o es Nuevo para incrementar el ID del Seguimiento
-- ## Hay 5 estatus diferentes
-- ## 1 abierto, 2 en progreso, 3 Rechazado, 4 Cancelado, 5 Cerrado
-- ## Solo los Esatus 4 y 5 Modifican las tablas Seguimiento y Reportes
-- ---------------------------------------------------------------------

    if(exists(SELECT Folio FROM SINTEGRALGNL.BSHSeguimientoReportes Where Folio=r_Folio AND NoDepartamento= r_NoDepartamento AND Anio = r_anio)) then

      SELECT @UltimoSeguimiento:=MAX(FolioSeguimiento) FROM BSHSeguimientoReportes WHERE Folio = r_Folio AND NoDepartamento= r_NoDepartamento AND Anio=r_anio;
      SET @UltimoSeguimiento=@UltimoSeguimiento + 1;
      insert into SINTEGRALGNL.BSHSeguimientoReportes VALUES(r_anio,r_Folio,@UltimoSeguimiento,r_NoDepartamento,r_TipoAtencion,r_Seguimiento,r_NoUsuarioSeguimiento,r_NoEstatus,r_FechaSeguimiento,r_HoraInicioSeguimiento);
      UPDATE BSHReportes SET Estatus=num_estatus WHERE Folio=num_folio AND NoDepartamento = r_NoDepartamento AND Anio=r_anio;

    ELSE

      insert into SINTEGRALGNL.BSHSeguimientoReportes VALUES(r_anio,r_Folio,@UltimoSeguimiento,r_NoDepartamento,r_TipoAtencion,r_Seguimiento,r_NoUsuarioSeguimiento,r_NoEstatus,r_FechaSeguimiento,r_HoraInicioSeguimiento);
      UPDATE BSHReportes SET Estatus=num_estatus WHERE Folio=num_folio AND NoDepartamento = r_NoDepartamento AND Anio=r_anio;

    END IF;

  end ;;
DELIMITER ;
